import ExpenseItem from "./Components/ExpenseItem";
function App() {

    const expenseProp = [
        {
            id: 1,
            title: "Gold Installment",
            amount: 15000,
            date: new Date(2021,7, 15)
        },
        {
            id: 2,
            title: "Mutual Fund",
            amount: 10000,
            date: new Date(2021,7, 10)
        }
    ];
  return (
    <div>
      <h2>Let's get started!</h2>
        <ExpenseItem title={expenseProp[0].title} amount={expenseProp[0].amount} date-={expenseProp[0].date}></ExpenseItem>
        <ExpenseItem title={expenseProp[1].title} amount={expenseProp[1].amount} date-={expenseProp[1].date}></ExpenseItem>
    </div>
  );
}

export default App;
